using System;
using System.IO;
using JetBrains.Annotations;
using Microsoft.AspNetCore.Builder;
using Microsoft.AspNetCore.Hosting;
using Microsoft.AspNetCore.Mvc;
using Microsoft.Extensions.DependencyInjection;
using Microsoft.Extensions.Logging;

namespace WebPlayground
{
    /*
         * Libuv.dll needs to be explicitly added to a .net core project referenced in this way.
         * Obviously the .NetCore team prefers you use xproj and the new tooling, but I wanted
         * to do this as a basic test to their theory that it was indeed usable from .net 4.6
         * since it is written in a .net standard way.
         */

    internal static class Program
    {
        private static void Main()
        {
            // Bare minimum for .net core mvc 6
            new WebHostBuilder().UseKestrel().UseStartup<Startup>().Build().Run();
        }
    }

    [UsedImplicitly(ImplicitUseTargetFlags.WithMembers)] // Resharper Specific
    internal class Startup
    {
        public void Configure(IApplicationBuilder app, IHostingEnvironment env, ILoggerFactory loggerFactory)
        {
            // Fluff that is not necessary to run, but provides information
            if (env.IsDevelopment())
            {
                loggerFactory.AddConsole();
                app.UseDeveloperExceptionPage();
            }

            // controller=home/action=index/id=null (Built in default route)
            app.UseMvcWithDefaultRoute();
        }

        public void ConfigureServices(IServiceCollection services)
        {
            services.AddMvc();
        }
    }
}

// Controller Namespace is important

namespace WebPlayground.Controllers
{
    [Route("/")] // MVC 6 Routing Attributes
    public class HomeController : Controller
    {
        // No Extra Files in Project
        private static readonly byte[] FavIconBytes =
            Convert.FromBase64String(
                @"");

        [HttpGet("")] // Default Route
        public IActionResult Index()
        {
            return Ok("Hello World, From Asp.Net Core (MVC 6) in regular VS15 .Net Project!");
        }

        [HttpGet("/favicon.ico")] // Specific Route
        [ResponseCache(Duration = 86400, Location = ResponseCacheLocation.Any)] // 1 Day Cache
        public FileResult SendFavIcon()
        {
            var ms = new MemoryStream(FavIconBytes); // No Using on this as the subsystem will close/dispose it.
            return new FileStreamResult(ms, "image/x-icon");
        }
    }
}